import { getYear } from "date-fns";
import ANBIMA from "./calendarios/brazil/tiposDeCalendarios/ANBIMA";

export default class Servicos {
  constructor() {}

  VerificarSeDiaUtil() {
    const anbima = new ANBIMA();
    let ListaDeFeriados = anbima.ObterListaDeFeriados(2020);
    return ListaDeFeriados;
  }
}
